export const REQUEST_API_DATA = "REQUEST_API_DATA";
export const RECEIVE_API_DATA = "RECEIVE_API_DATA";
export const requestApiData = (query) => ({ type: REQUEST_API_DATA });
export const receiveApiData = (data, query) => ({ type: RECEIVE_API_DATA, data, query });
